import { Page } from "../models/Page";
import ESAR from "./es-AR";
import PTBR from "./pt-BR";

interface ILanguages{
    "pt-BR": Page;
    "es-AR": Page
}
const languages: ILanguages = {
    "pt-BR": PTBR,
    "es-AR": ESAR,
};
export default languages;
